import SideMenu from './components/SideMenu/dashboard';


function App() {
  return (
    <div className="App">
      <AppHeader />
      <div className='pagecategory'>
        <Space>
          <SideMenu></SideMenu>
          <PageContent></PageContent>

        </Space>  
      </div>
      <AppFooter />


    </div>
  );
}

export default App;
